    <div
      style={{
        display: "flex",
        flexWrap: "wrap",
        width: "100%",
        // backgroundColor: "red",
      }}
    >
      <h2 className="heading--2">Recipe ingredients</h2>

      {ingredients.map((ingre) => {
        console.log("ingre: ", ingre);
        return (
          <div style={{ width: "50%", paddingBottom: "50px" }}>{ingre}</div>
        );
      })}
    </div>
  );
};

export default Body;
